import React, { useState } from "react";
import MoleculeViewer from "./MoleculeViewer";
import ToxicFragmentHighlight from "./ToxicFragmentHighlight";

export default function App() {
  const [smiles, setSmiles] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const endpointMeaning = {
    "NR-AR": "Androgen",
    "NR-AR-LBD": "AR-Binding",
    "NR-AhR": "Pollutants",
    "NR-Aromatase": "Hormones",
    "NR-ER": "Estrogen",
    "NR-ER-LBD": "ER-Binding",
    "NR-PPAR-gamma": "Metabolism",
    "SR-ARE": "Oxidative",
    "SR-ATAD5": "DNA-Repair",
    "SR-HSE": "Heat-Shock",
    "SR-MMP": "Mitochondria",
    "SR-p53": "DNA-Damage",
  };

  async function handlePredict() {
    if (!smiles.trim()) return alert("Please enter a SMILES string!");
    setLoading(true);
    setResult(null);

    try {
      const res = await fetch("http://127.0.0.1:5000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ smiles }),
      });

      const data = await res.json();
      setResult(data);
    } catch (err) {
      setResult({ error: "Backend not reachable" });
    } finally {
      setLoading(false);
    }
  }

  function getBadge(risk) {
    const colors = {
      "Non-Toxic": "#4CAF50",
      "Medium Risk": "#FFC107",
      Toxic: "#F44336",
    };
    return {
      background: colors[risk] || "#999",
      padding: "4px 10px",
      borderRadius: "8px",
      color: "white",
      fontWeight: "bold",
      fontSize: "0.8rem",
    };
  }

  return (
    <div
      style={{
        fontFamily: "Inter, sans-serif",
        background: "#f5f7fb",
        minHeight: "100vh",
        padding: "40px 0",
        display: "flex",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          width: "650px",
          background: "white",
          padding: "30px",
          borderRadius: "16px",
          boxShadow: "0 4px 18px rgba(0,0,0,0.1)",
        }}
      >
        <h1 style={{ fontSize: "1.8rem", marginBottom: "12px" }}>
          ðŸ§ª Toxicity Predictor (GNN)
        </h1>

        {/* SMILES Input */}
        <label style={{ fontWeight: "600" }}>Enter SMILES:</label>
        <input
          value={smiles}
          onChange={(e) => setSmiles(e.target.value)}
          placeholder="Example: CCO"
          style={{
            width: "100%",
            padding: "12px",
            marginTop: "8px",
            marginBottom: "20px",
            borderRadius: "10px",
            border: "1px solid #ddd",
          }}
        />

        {/* 2D Molecule Viewer */}
        {smiles && <MoleculeViewer smiles={smiles} />}

        {/* Predict Button */}
        <button
          onClick={handlePredict}
          disabled={loading}
          style={{
            width: "100%",
            padding: "12px",
            background: loading ? "#888" : "#4f46e5",
            border: "none",
            color: "white",
            fontSize: "1rem",
            borderRadius: "10px",
            marginBottom: "20px",
          }}
        >
          {loading ? "Predictingâ€¦" : "ðŸš€ Predict Toxicity"}
        </button>

        {/* Toxic Fragment Detection */}
        {smiles && <ToxicFragmentHighlight smiles={smiles} />}

        {/* Results */}
        {result && result.predictions && (
          <div style={{ marginTop: "20px" }}>
            <h2>Results</h2>

            <table
              style={{
                width: "100%",
                borderCollapse: "collapse",
                marginTop: "10px",
              }}
            >
              <thead>
                <tr style={{ background: "#eee" }}>
                  <th style={{ padding: "8px" }}>Endpoint</th>
                  <th style={{ padding: "8px" }}>Meaning</th>
                  <th style={{ padding: "8px" }}>Probability</th>
                  <th style={{ padding: "8px" }}>Risk</th>
                </tr>
              </thead>

              <tbody>
                {Object.entries(result.predictions).map(
                  ([key, values], idx) => (
                    <tr key={idx} style={{ borderBottom: "1px solid #ddd" }}>
                      <td style={{ padding: "8px" }}>{key}</td>
                      <td style={{ padding: "8px", fontStyle: "italic" }}>
                        {endpointMeaning[key]}
                      </td>
                      <td style={{ padding: "8px" }}>
                        {(values.probability * 100).toFixed(2)}%
                      </td>
                      <td style={{ padding: "8px" }}>
                        <span style={getBadge(values.risk_level)}>
                          {values.risk_level}
                        </span>
                      </td>
                    </tr>
                  )
                )}
              </tbody>
            </table>

            {/* Properties Panel */}
            {result.properties && (
              <div
                style={{
                  marginTop: "20px",
                  background: "#eef2ff",
                  padding: "20px",
                  borderRadius: "10px",
                }}
              >
                <h3>Physicochemical Properties</h3>
                <table>
                  {Object.entries(result.properties).map(([k, v]) => (
                    <tr key={k}>
                      <td style={{ fontWeight: "600", paddingRight: "15px" }}>
                        {k}:
                      </td>
                      <td>{v.toFixed(3)}</td>
                    </tr>
                  ))}
                </table>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
}
